import {all,fork,take,takeEvery,takeLatest,put,delay} from "redux-saga/effects"
import axios from "axios"
import userSaga from "./userSaga"
import postSaga from "./postSaga"

export default function* rootSaga(){
    yield all([
        fork(userSaga),
        fork(postSaga),
    ]);
}
